import React from 'react';
import './Footer.css';

const Footer = () => {
    let currentYear = new Date().getFullYear()

    return (
        <div className='footer'>
            <div>
                <p>Made with love by us &lt;3 {"\n"}</p>    
            </div>

            <div>
                <p>&#169;{currentYear} by The Inkwell</p>
            </div>
        </div>
    )
}

export default Footer;
